const headers = {
  "Content-type": "application/json",
};
const sendData = (noOfStudents, totalClasses, expense, revenue, profit) => {
  const data = JSON.stringify({
    noOfStudents,
    totalClasses,
    expense,
    revenue,
    profit,
  });
  axios
    .get(`${process.env.REACT_APP_DEV_URL}/add/`, data, {
      headers,
    })
    .then((res) => {
      let dataToSend = res.data;
      console.log(dataToSend);
    })
    .catch((e) => {
      console.log(e);
      dataToSend = null;
    });
};
